import { useGlobalContext } from '../context';

import React, { useState, Fragment } from "react";
import { nanoid } from "nanoid";
import "./../App.css";
import DeleteOutlinedIcon from '@mui/icons-material/DeleteOutlined';
import EditIcon from '@mui/icons-material/Edit';
import { Grid } from '@mui/material';
import { Link } from 'react-router-dom';

const Roles = () => {
  const {roles, deleteRole, role} = useGlobalContext()

  console.log("ROLEESS", roles)
  console.log("ROLEE", role)

    return (
      <div style={{display: 'flex', marginTop: 80, justifyContent: "center"}} >
         <div className="app-container">

<table>
  <thead>
    <tr>
      <th>Role Name</th>
      <th>Role Id Delete</th>
      <th>Role Id Edit</th>

    </tr>
  </thead>
  <tbody>
  {roles.map((role) => (
    <tr>
      {role.deleted === 'no' &&  (
        <>
        <td>
        {role.role_name}
    </td>
    <td>
    <Grid item xs={8}>
        {role.role_id}
        <DeleteOutlinedIcon onClick={() => deleteRole(role.role_id)}/>
    </Grid>
    </td>
    <td>
    <Grid item xs={8}>
        {role.role_id}
        <Link to={`/${role.role_id}`}>
        <EditIcon/>
        </Link>
        
    </Grid>
    </td>
    </>
      )
      }
    </tr>
  ))}
  </tbody>
</table>

</div>
      </div>
     
    );
  };
  

export default Roles
